import React from 'react';

import '../styles/Item';

interface Props {
  item: {
    title: string;
    link: string;
    creator: string;
    pubDate: string;
    category: Array<string>;
    guid: string;
    description: string;
    encoded: string;
    commentRss: string;
    post_id: number;
    image: {
      url: string;
      title: string;
    }
  }
}


class Item extends React.Component {
  props: Props;

  constructor(props: Props) {
    super(props)
  }

  render(): any {
    return(
      <div className="Item">
        <img src={this.props.item.image.url} alt={`${this.props.item.image.title} logo`}/>
        <a href={this.props.item.link}> { this.props.item.title } </a>
      </div>
    );
  }
}

export default Item;
